			Rows.Add( new DocumentationRow("ID_HELP_EXPORTINGWORKSHEETS", "Once you have set the Export Options, chosen a Export Type, and corrected any errors in your data you may export the data from Google, and it will save as either a generated Game Object, Static Class, or Data File.\n\n- Object Database: This type of database will generate a Game Object in your scene, attach a generated class, and save all the data in it. If the Game Object is deleted from the scene, or the script is removed it will destroy the data.\n\n- Static Database: This type of database is a generated class that you can access as a Singleton instance. The first time you access the class, all of the data will be initialized. All of the data is stored statically within the generated file, so it can be moved around at your convenience.\n\n- CSV: This is a generated CSV file that contains your data. It is up to you to parse the CSV file with a method of your choice.\n\n- XML: Like CSV, all of your data is saved in a generated XML file. It is up to you to parse it.\n\n- JSON: There are a few options for generating a JSON file that contains your data. For your convenience Google2u also generates a class that is specific to your JSON data, and can be used by JSON .NET to load it.\n\n- NGUI: This is basically the same as a CSV file, but is recognized by NGUI for localization.\n\n- Playmaker: You can as an option export generated Playmaker actions along with the Object Database. These actions are custom generated to access the data in the Object Database by Playmaker.", "Une fois que vous avez dÃ©fini les options d'exportation, choisi un type d'exportation, et corrigÃ© des erreurs dans vos donnÃ©es, vous pouvez exporter les donnÃ©es de Google, et il sera l'enregistrement comme un objet gÃ©nÃ©rÃ© de jeu, statique classe, ou fichier de donnÃ©es.\n\n- Base de donnÃ©es de l'objet: Ce type de base de donnÃ©es gÃ©nÃ¨re un objet de jeu dans votre scÃ¨ne, joindre une classe gÃ©nÃ©rÃ©e, et enregistrer toutes les 